import React, { useEffect, useState } from 'react'

function Feedback() {
    const [contact,setcontact] = useState({})
    useEffect(()=>{
        axiosInstance
        .post(`/viewContacts`)
        .then((res) => {
          console.log(res, " view contacts");
          if (res.data.data != undefined) {
            setcontact(res.data.data);
          }
        })
        .catch((err) => {
          console.log(err);
        });
    },[])
  return (
    <div>Feedback</div>
  )
}

export default Feedback
